import React, { Component } from "react";
import ReszvetelService from "../service/ReszvetelService";

class EredmenyComponent extends Component {
  constructor(props) {
    super(props);
    this.state = {
      reszvetelek: {},
    };
  }
  componentDidMount() {
    ReszvetelService.getResztvetelek().then((res) => {
      this.setState({ reszvetelek: res.data });
      console.log(this.state.reszvetelek);
    });
  }
  render() {
    return (
      <div>
        {this.state.reszvetelek.map((kiallitas) => (
          <div
            className="oneRow"
            style={{ display: "flex", justifyContent: "space-around" }}
            key={kiallitas.id}
          >
            <span>{kiallitas.kiallitas.helyseg}</span>
          </div>
        ))}
      </div>
    );
  }
}

export default EredmenyComponent;
